import React, { Component } from "react";

class Process extends Component {
  state = {
    processName: "Proceso numero 1"
  };

  handleView() {
    console.log("Click View");
  }
  handleEdit() {
    console.log("Click View");
  }
  handleDelete() {
    console.log("Click View");
  }

  render() {
    return (
      <div>
        <span>
          <span className="processClass alert alert-primary m-2">
            {this.state.processName}
          </span>
          <button onClick={handleView} className="btn btn-primary btn-sm m-1">
            View
          </button>
          <button onClick={handleEdit} className="btn btn-secondary btn-sm m-1">
            Edit
          </button>
          <button onClick={handleDelete} className="btn btn-danger btn-sm m-1">
            Delete
          </button>
        </span>
      </div>
    );
  }
}

export default Process;
